scriptlet.script:
try {
	var count = parseInt(count);
	if (count < 1) {
		throw new Error("Lab was not reserved for subscription: " + subscription);	
	}
	else if (count > 1) {
		throw new Error("Muliple labs reserved for subscription: " + subscription);	
	}
	else {
		scriptletResponse="success";
	}
}
catch(Error) {
	scriptletContext.put("FailureMessage",Error);
	scriptletResponse="failure";
}
